import React, { FunctionComponent, ReactElement } from 'react';
import { 
  Box,
  Button,
  Typography
} from '@material-ui/core';


import '../styling/remixPlaying.css';

type RemixPlayingProps = {
  cover: string
}

const RemixPlaying: FunctionComponent<RemixPlayingProps> = (props): ReactElement => {  
  return(
    <Box
      display='flex'
      flexDirection='row'
    >
      {{ propscover }}
      <Box
        id='remix-information'
      >
        <Typography>test drive</Typography>
        <Typography>Ariana Grande</Typography>
        <Typography>2min 02 secs</Typography>
      <Box
        id='remix-creator'
      >
        image
        ernest
      </Box>
      </Box>
    </Box>
    )
}

export default RemixPlaying;
